`,paraId:1},{value:`// 4.\u83B7\u53D6\u6570\u636E\u5BF9\u5E94\u7684\u4F4D\u7F6E
DoublyLinkedList.prototype.indexOf = function (data) {
  var current = this.head;
  var index = 0;
  while (current) {
    if (current.data === data) return index;
    current = current.next;
    index += 1;
  }

  return -1;
};
