  // \u8FED\u4EE3\u5199\u6CD5
  let stack = []; // \u6808
  stack.push(this.root); // \u5148\u5C06root\u5165\u6808

  while (stack.length !== 0) {
    let node = stack.pop(); // 1.\u8282\u70B9\u51FA\u6808
    handler(node.key); // 2.\u5904\u7406\u8282\u70B9 \u8FD9\u91CC\u505A\u6253\u5370\u5373\u53EF
    // 3. \u56E0\u4E3A\u5148\u5E8F\u904D\u5386\u662F\u5148\u6253\u5370\u5DE6\u8282\u70B9\u7684\u503C\uFF0C\u6839\u636E\u6808\u5148\u5165\u540E\u51FA\u7684\u7279\u6027
    // \u6240\u4EE5\u8FD9\u91CC\u9700\u8981\u5148\u8BA9\u53F3\u8282\u70B9\u5165\u6808
    if (node.right !== null) {
      stack.push(node.right);
    }
    // 4.\u5DE6\u8282\u70B9\u5165\u6808
    if (node.left !== null) {
      stack.push(node.left);
    }
  }

