var replaceSpace = function (s) {
  // return s.replaceAll(' ', '%20');
  const res = s.split('');
  for (let i = 0; i < res.length; i++) {
    if (res[i] === ' ') {
      res[i] = '%20';
    }
  }
  return res.join('');
};
