`,paraId:0},{value:"\u4E2D\u5E8F\u904D\u5386\uFF0C\u6839\u7ED3\u70B9\u4F4D\u7F6E\u4E4B\u524D\u7684\u5C31\u662F\u5DE6\u5B50\u6811\uFF0C\u4E4B\u540E\u7684\u5C31\u662F\u53F3\u5B50\u6811\uFF0C\u6240\u4EE5\u6839\u636E\u6839\u8282\u70B9\u6240\u5728\u4F4D\u7F6E\uFF0C\u5F88\u5BB9\u6613\u5199\u51FA\u4E2D\u5E8F\u904D\u5386\u7ED3\u6784\uFF0C\u5DE6\u53F3\u5B50\u6811\u7684\u8303\u56F4",paraId:0},{value:"\u96BE\u70B9\u5728\u4E8E \uFF1F\uFF1F\uFF1F \u7684\u4F4D\u7F6E\u5982\u679C\u5212\u5206\uFF08\u4E5F\u5C31\u662F\u524D\u5E8F\u904D\u5386\uFF0C\u5DE6\u53F3\u5B50\u6811\u7684\u8303\u56F4\uFF09",paraId:0},{value:"\u53EF\u4EE5\u4ECE\u4E2D\u5E8F\u904D\u5386\u5165\u624B\uFF0C\u53EF\u4EE5\u4ECE\u6839\u7ED3\u70B9\u5230\u5F00\u59CB\u7684\u4F4D\u7F6E\uFF0C\u77E5\u9053\u5DE6\u5B50\u6811\u7684\u957F\u5EA6",paraId:0},{value:"\u5728\u524D\u5E8F\u904D\u5386\u4E2D\uFF0C\u5DE6\u5B50\u6811\u7684\u4F4D\u7F6E\u8303\u56F4\u5C31\u662F \uFF08preStart+1 , preStart + leftSize\uFF09",paraId:0},{value:"\u53F3\u5B50\u6811\u7684\u4F4D\u7F6E\u8303\u56F4\u5C31\u662F\uFF08preStart + leftSize +1 , preEnd\uFF09",paraId:0},{value:"\u6700\u540E\u627E\u51FAbase case \u8DF3\u51FA\u9012\u5F52\u7684\u6761\u4EF6\uFF0CpreStart > preEnd \u5C31\u8FD4\u56DEnull",paraId:0},{value:`/**
 * @param {number[]} preorder
 * @param {number[]} inorder
 * @return {TreeNode}
 */
var buildTree = function (preorder, inorder) {
  return build(
    preorder,
    0,
    preorder.length - 1,
    inorder,
    0,
    inorder.length - 1
  );
};

const build = (preorder, preStart, preEnd, inorder, inoStart, inoEnd) => {
  if (preStart > preEnd) return null;
  const rootVal = preorder[preStart];
  const inoRootIndex = inorder.indexOf(rootVal);

  const leftSize = inoRootIndex - inoStart;

  const root = new TreeNode(rootVal);

  root.left = build(
    preorder,
    preStart + 1,
    preStart + leftSize,
    inorder,
    inoStart,
    inoRootIndex - 1
  );
  root.right = build(
    preorder,
    preStart + leftSize + 1,
    preEnd,
    inorder,
    inoRootIndex + 1,
    inoEnd
  );
  return root;
};
