\u7A7A\u95F4\u590D\u6742\u5EA6O(1)`,paraId:30,tocIndex:61},{value:"\u601D\u8DEF\uFF1A",paraId:0},{value:"\u4E2D\u5E8F\u904D\u5386BST",paraId:0},{value:"\u904D\u5386\u8FC7\u7A0B\u4E2D\u4FDD\u7559\u4E0A\u4E00\u4E2A\u8282\u70B9prev\u548C\u5F53\u524D\u8282\u70B9cur",paraId:0},{value:"\u82E5\u904D\u5386\u8FC7\u7A0B\u4E2D\u53D1\u73B0\u4E0A\u4E00\u4E2A\u8282\u70B9prev\uFF0C\u5C31\u662F\u8981\u627E\u7684\u8282\u70B9p\uFF0C\u90A3\u4E48\u5F53\u524D\u8282\u70B9cur\u5C31\u662F\u8BE5BST\u7684\u540E\u7EE7",paraId:0},{value:"\u82E5p\u662F\u6700\u540E\u4E00\u4E2A\u8282\u70B9\uFF0C\u90A3\u4E48\u9700\u8981\u8FD4\u56DEnull",paraId:0},{value:`/**
 * Definition for a binary tree node.
 * function TreeNode(val) {
 *     this.val = val;
 *     this.left = this.right = null;
 * }
 */

/**
 * @param {TreeNode} root
 * @param {TreeNode} p
 * @return {TreeNode}
 */
var inorderSuccessor = function (root, p) {
  let prev = null;
  let cur = root;
  let stack = [];
  while (stack.length || cur) {
    while (cur) {
      stack.push(cur);
      cur = cur.left;
    }

    cur = stack.pop();
    if (prev === p) {
      // \u82E5prev\u662Fp\uFF0C\u5219\u8FD4\u56DEcur
      return cur;
    }
    prev = cur;
    cur = cur.right;
  }
  return null;
};
