var reverseWords = function (s) {
  const singleWorldNums = s.split(' ');
  return singleWorldNums
    .map((item) => {
      return reverseString(item.split('')).join('');
    })
    .join(' ');
};

var reverseString = function (s) {
  if (s.length === 0 || s.length === 1) return s;
  let left = 0,
    right = s.length - 1;

  const swap = (i, j) => {
    let temp = s[i];
    s[i] = s[j];
    s[j] = temp;
  };

  while (left < right) {
    swap(left, right);
    left++;
    right--;
  }
  return s;
};
